import React from 'react';

import './WorkExperience.css';
import { Jumbotron } from 'react-bootstrap';

import { ReactComponent as WorkIcon } from './work.svg';
import { ReactComponent as SchoolIcon } from './school.svg';

export default props => {
    return(
        <a name="experience">
            <div className="work-experience">
                <Jumbotron style={{ backgroundColor: "#fff" }}>
                    <h1 className="work-title">Bachelor's of Science in Computer Science</h1>
                    <p>
                        University of Nevada, Las Vegas (UNLV)<br/>
                        Minor: Mathematics <br/>
                        Concentration: Information Assurance <br/>
                        Honors: Cum Laude <br/>
                    </p>
                </Jumbotron>

                <Jumbotron style={{ backgroundColor: "#fff" }}>
                    <h1 className="work-title">Network Technician</h1>
                    <p>
                        UNLV Network Development and Engineering <br/>
                        Minor: Mathematics <br/>
                        Concentration: Information Assurance <br/>
                        Honors: Cum Laude <br/>
                    </p>
                </Jumbotron>
            </div>
        </a>
    );
}
